let user = require("../../registration/registration");

const RegistrationWithInput = () => {
  return (
    <div>
      <div>
        {Object.keys(user?.registrationWithInputFeild).map(value => {
          return (
            <div>
              <lable>{user?.registrationWithInputFeild?.[value]?.msg}</lable>
              <input
                type={user?.registrationWithInputFeild?.[value]?.inputType}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default RegistrationWithInput;
